import React from "react";
import {
  AiFillGithub,
  AiFillSetting,
  AiFillQuestionCircle,
} from "react-icons/ai";

const NavBar = () => {
  return (
    <div>
      <div
        className="fixed top-0 left-0 w-full h-10 m-0 
      flex flex-row justify-end items-center bg-gray-700 text-white shadow-md"
      >
        <SideBarIcon icon={<AiFillSetting size="36" />} />
        <SideBarIcon icon={<AiFillQuestionCircle size="36" />} />
        <SideBarIcon icon={<AiFillGithub size="36" />} />
      </div>
    </div>
  );
};

const SideBarIcon = ({ icon }) => {
  return <div className="sidebar-icon mx-2">{icon}</div>;
};

export default NavBar;
